\begin{align*}
 \frac{\partial c_q}{\partial t} & = D \frac{\partial^2 c_q}{\partial x^2} + \sum_{n=1}^{N_q} H_s(C_{q,n} -K_H) \left( \hat{\beta}(C_{q,n}) C_{q,n} - \hat{\alpha} c_q(x_{q,n}) \right) \delta(x - x_{q,n}), & 1 \le q \le Q, \, 0 \le x \le {L_{q}}, \\
 \frac{\mathrm{d} C_{q,n}}{\mathrm{d} t} & = H_s(C_{q,n} -K_H) \left\{ \alpha P - \beta(C_{q,n}) C_{q,n}+ \hat{\alpha} c_q(x_{q,n}) - \hat{\beta}(C_{q,n}) C_{q,n} \right\}, & 1 \le q \le Q, \, 1 \le n \le {N_{q}}, \\
 \frac{\mathrm{d} P}{\mathrm{d} t} & =\sum_{q=1}^{Q} \sum_{n=1}^{N_q} H_s(C_{q,n}-K_H) \left\{ \beta(C_{q,n}) C_{q,n} - \alpha P \right\}, 
\end{align*}

\begin{align*}
\frac{\partial c_q}{\partial x} = 0 \quad \textrm{at } x=0 \, \textrm{ and } \, x=L_q, \quad 1 \le q \le Q. 
\end{align*}

\begin{align*}
C_{q,n}(t=0) = R_{RI} F \frac{\hat{C}_{q,n} } { \sum_{q'=1}^{Q} \sum_{n'=1}^{N_q} \hat{C}_{q',n'} }, \qquad c_q(t=0) = \frac{R_{SC} F}{\sum_{q'=1}^{Q} L_{q'}}, \quad P(t=0) =0
\end{align*}
